import logo from './logo.svg';
import 'bulma/css/bulma.min.css';
import './App.css';
import headPic from './Stick&Puck.jpg';

function App() {
  return (
    <div className="section">
      <div className="container">
        <h1>Hockey Comparison Tool</h1>
        <img src={headPic} alt="headPic" />
      </div>
    </div>
  );
}

export default App;
